function Error({ statusCode }) {
	return (
		<div className="black-background">
            <p> Error {statusCode} rebel scum has corrupted the files</p>
            <p>Type any letter in the field and click enter to return</p>
            <input type="text" id="one" onKeyUp={handleKeyPress} />
        </div>
	);
}

const handleKeyPress=(event)=>{
    if (event.key === 'Enter'){
        window.location.href="/"
    }
}

function getInitialProps({ res, err }) {
	let statusCode;
	if (res) {
		statusCode = res.statusCode;
	} else if (err) {
		statusCode = err.statusCode;
	} else {
		statusCode = null;
	}
	return { statusCode };
}

Error.getInitialProps = getInitialProps;

export default Error;
